import axios from 'axios'


const createPost=()=>{
  const pushPost=async ()=> {
        try {
          const data = await axios.get(`https://simple-blog-api.crew.red/posts`);
        //   console.log('data', data.data)
          return data.data;
        } catch (error) {
          console.log("GetSummaryError", error);
        ;
          throw new Error();
        }
      }


    return (
        <>
        </>
    )


}
export default createPost
